import static com.jayway.jsonpath.JsonPath.parse

def response = context.expand( '${Get models collection#Response}' )

def models = parse(response).read('$.models')
//log.info models

//def simpleModelName = context.expand('${#TestSuite#simple_model}')
def simpleModelName = testRunner.testCase.testSuite.getPropertyValue( "simple_model" )
def simpleModelFound = models.find { it.model_name == simpleModelName }
if (simpleModelFound == null) testRunner.fail(simpleModelName + ' not found in Model List')
def complexModelName = testRunner.testCase.testSuite.getPropertyValue( "complex_model" )
def complexModelFound = models.find { it.model_name == complexModelName }
if (complexModelFound == null) testRunner.fail(complexModelName + ' not found in Model List')
//log.info complexModelFound

//if (simpleModelFound && complexModelFound) testRunner.gotoStepByName("Get JSON for simple model")

import static com.jayway.jsonpath.JsonPath.parse

def response = context.expand( '${Get simulations list#Response}' )

def simus = parse(response).read('$.simulations')
//log.info models

def simu1 = testRunner.testCase.getPropertyValue( "simulation_1" )
//log.info simu1
def simu1Report = simus.find { it.simulation_name == simu1 }
def simu1Status = simu1Report.info.status
log.info simu1Status

def simu2 = testRunner.testCase.getPropertyValue( "simulation_2" )
//log.info simu1
def simu2Report = simus.find { it.simulation_name == simu2 }
def simu2Status = simu2Report.info.status
log.info simu2Status

if (simu1Status == 'RUNNING' || simu1Status == 'RUNNING') testRunner.gotoStepByName("Get simulations list")
//if (simu1Status != 'FINISHED' || simu1Status != 'FINISHED') testRunner.fail(simu1 + 'should be FINISHED but is ' + simu1Status)

//if (simpleModelFound && complexModelFound) testRunner.gotoStepByName("Get JSON for simple model")

